import React from "react";
import { Link } from "react-scroll";
import { useNavigate } from "react-router-dom";

const NavbarLink = ({ to, label }) => (
  <li>
    <Link
      to={to}
      smooth={true}
      duration={500}
      activeClass="active-link"
      className="cursor-pointer hover:text-cyan-400 transition"
    >
      {label}
    </Link>
  </li>
);

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/");
  };

  return (
    <nav className="backdrop-blur-lg bg-opacity-20 bg-black fixed top-0 w-full p-4 flex justify-between items-center shadow-lg z-50">
      <h1 className="text-3xl font-bold text-cyan-400">QuickRent</h1>

      <ul className="hidden md:flex space-x-6 text-white">
        <NavbarLink to="features" label="Features" />
        <NavbarLink to="gadgets" label="Gadgets" />
        <NavbarLink to="contact" label="Contact" />
      </ul>

      <button
        onClick={handleLogout}
        className="bg-cyan-400 text-black px-6 py-2 rounded-md hover:bg-cyan-500 transition"
      >
        Logout
      </button>
    </nav>
  );
};

export default Navbar;
